const defaultstate = {
    last: 'd',
    now: ''
}

const reducer = (state = defaultstate, action) => {
    switch (action.type) {
        case 'NEW':
            return {
                last: `${action.whatNew}`,
                now: 'xd'
            };
        default:
            return state;
    }
} 

export default reducer;
